//画布context，是否是测量，文字，左，上，宽，字体大小，颜色，行高，行数,加粗
export const drawText = (
  context: any,
  isFill: any,
  t: any,
  x: any,
  y: any,
  w: any,
  s: any,
  c: any,
  h: any,
  r: any,
  b: any,
  scale = 1,
  callback: any
) => {
  x = x * scale;
  y = y * scale;
  w = w * scale;
  s = s * scale;
  h = h * scale;
  let chr = t.split("");
  let temp = "";
  let row = [];
  context.font = (b ? "bold" : "normal") + " " + s + "px alfont";
  context.fillStyle = c;
  context.textBaseline = "middle";
  for (let a = 0; a < chr.length; a++) {
    if (context.measureText(temp).width > w) {
      if (row.length + 1 === r) {
        row.push(temp.replace(/.$/, "..."));
        break;
      }
      row.push(temp);
      temp = "";
    }
    temp += chr[a];
  }
  if (row.length < r && temp) row.push(temp);
  if (isFill) {
    for (let b = 0; b < row.length; b++) {
      context.fillText(row[b], x, y + (b + 1) * h);
    }
  }
  callback && callback(row, context.measureText(t).width);
};

